Hotel Eden (NEW 2014 Viv Thomas) [DVDRip]

Lorena, Demi, Whitney Conroy

Lorena is looking at her father's hotel for the holidays and mischievously moves her girlfriend, Demi, in. Things fall apart when Demi has to leave for business and Whitney arrives. Gorgeous, young and full of fun she seduces Lorena in a beautifully filmed story, set in a luxurious riverside hotel.

